export function login(payload){
    const url = "https://frebi.willandskill.eu/api-token-auth/"
    console.log(JSON.stringify(payload))
    fetch(url,{
        method: "POST", 
        body: JSON.stringify(payload),
        headers: {
            "Content-type": "application/json"
          }
    })
    .then(res => res.json())
    .then(data =>{
        console.log(data)
    })
}
